import base64
import io
from PIL import Image
import io



base64str = ""


bytes_data = base64.b64decode(base64str)
buffer = io.BufferedReader(io.BytesIO(bytes_data))

# Assume that 'buffer' is a BufferedReader object containing image data

# Load the image data into a PIL Image object
image = Image.open(io.BytesIO(buffer.read()))

# Save the image to a JPEG file
with open('image.jpg', 'wb') as f:
    image.save(f, format='JPEG')

